import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Header from "../src/components/header.js";

function App() {
  return (
    <Router>
      <Header />
      <Switch>
        <Route path="../components/homepage.js" exact>
          <h1>Home Page</h1>
        </Route>
        <Route path="/about-us">
          <h1>About Us</h1>
        </Route>
        <Route path="/wellness-history">
          <h1>Wellness History</h1>
        </Route>
        <Route path="/resources">
          <h1>Resources</h1>
        </Route>
        <Route path="/profile">
          <h1>Profile</h1>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
